  <body>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Receiving vs Sending</h1>
    </div>
    <svg id="rate" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      Sending&nbsp;<sub>min</sub>:&nbsp;<input id="rateXMin"/>;
      Sending&nbsp;<sub>max</sub>:&nbsp;<input id="rateXMax"/>;
      Receiving&nbsp;<sub>min</sub>:&nbsp;<input id="rateYMin"/>;
      Receiving&nbsp;<sub>max</sub>:&nbsp;<input id="rateYMax"/>;
      <button onclick="applyRateDomains()">Apply</button>
      <button onclick="resetRateDomains()">Reset</button>
    </div>
    <script>
      var rateData = [{"color": "#c0c0c0", "values": [{"y": 120919.56126325391, "x": 120919.56126325391}, {"y": 125599.78836065195, "x": 125599.78836065195}, {"y": 128732.95290085823, "x": 128732.95290085823}, {"y": 135031.9197735521, "x": 135031.9197735521}, {"y": 136317.18619230701, "x": 136317.18619230701}, {"y": 143763.30294403786, "x": 143763.30294403786}, {"y": 148353.95046277985, "x": 148353.95046277985}, {"y": 155704.63649600296, "x": 155704.63649600296}], "key": "Reference"}, {"color": "#000000", "values": [{"y": 120918.67852313208, "x": 120919.56126325391}, {"y": 125598.68761462977, "x": 125599.78836065195}, {"y": 128726.15411752836, "x": 128732.95290085823}, {"y": 135026.15357653081, "x": 135031.9197735521}, {"y": 136294.85755171781, "x": 136317.18619230701}, {"y": 143740.43449638292, "x": 143763.30294403786}, {"y": 148341.09392592747, "x": 148353.95046277985}, {"y": 155703.98541086412, "x": 155704.63649600296}], "key": "Test AWS"}]

      var rateChart
      var rateXMin = document.getElementById("rateXMin"),
          rateXMax = document.getElementById("rateXMax"),
          rateYMin = document.getElementById("rateYMin"),
          rateYMax = document.getElementById("rateYMax")

      var applyRateDomains = function() {
        rateChart.xDomain([rateXMin.value, rateXMax.value])
        rateChart.yDomain([rateYMin.value, rateYMax.value])
        rateChart.update()
      }

      var resetRateDomains = function() {
        rateChart.xDomain(null)
        rateChart.yDomain(null)
        rateChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#rate')
          rateChart = nv.models.lineChart()
          rateChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = rateChart.xAxis.domain(),
                  yDomain = rateChart.yAxis.domain()
              rateXMin.value = xDomain[0]
              rateXMax.value = xDomain[1]
              rateYMin.value = yDomain[0]
              rateYMax.value = yDomain[1]
            })

          rateChart.xAxis
            .axisLabel("Sending, QpS")
            .showMaxMin(false)

          rateChart.yAxis
            .axisLabel("Receiving, QpS")
            .showMaxMin(false)

          svg.datum(rateData).call(rateChart)

          return rateChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#rate')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

<div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1>Queries Count</h1>
    </div>
    <svg id="counts" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      count&nbsp;<sub>min</sub>:&nbsp;<input id="countsYMin"/>;
      count&nbsp;<sub>max</sub>:&nbsp;<input id="countsYMax"/>;
      <button onclick="applyCountsDomains()">Apply</button>
      <button onclick="resetCountsDomains()">Reset</button>

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#latency')
          latencyChart = nv.models.lineWithFocusChart()
          latencyChart
            .width(svg.attr('width'))

          latencyChart.xScale(d3.scale.log())

          latencyChart.xAxis
            .tickFormat(function(d) {
              if (d == null) {
                return 'N/A'
              }

              if (d > 999) {
                return d3.format(',.0f')(d/1000) + 'k'
              }

              if (d < 1000 && d > 0.999) {
                return d3.format(',.0f')(d)
              }

                return  d3.format(',.1f')(d)
              }

              if (d < 0.1 && d > 0.00999) {
                return d3.format(',.2f')(d)
              }

              return d3.format(',.3f')(d)
            })
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.yAxis
            .axisLabel("count, %")
            .showMaxMin(false)

          svg.datum(latencyData).call(latencyChart)

          return latencyChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#latency')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })

      nv.addGraph({

              var yDomain = queueChart.yAxis.domain()
              queueYMin.value = yDomain[0]
              queueYMax.value = yDomain[1]

            .axisLabel("count")
            .showMaxMin(false)
